import React from 'react'
import TeamMenber from './TeamMember';

function Team() {
    return (
        <div className = "row">
            <TeamMenber 
            info = {
                {   
                    img:'/img/images.jpg',
                    name: "hassan",
                    position: "Bagdad",
                    phone: "+964 307802489",
                    emaile:"website@email.com",
                }
            } />
            <TeamMenber 
                info = {
                {
                    name: "Ameer",
                    position: "Najaf",
                    phone: "+964 307802489",
                    emaile:"website@email.com",
                }
            } />
            <TeamMenber 
            info = {
                {
                    name: "Kadem",
                    position: "Hela",
                    phone: "+964 307802489",
                    emaile:"website@email.com",
                }
            } />
        </div>
        
    )
}

export default Team;
